import React, { useEffect, useState, ussEffect } from "react";
import axios from "axios";

const CatList = () => {
  const [cats, setCats] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8000/cats")
      .then((response) => {
        setCats(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <h1>고양이 리스트</h1>
      <ul>
        {cats.map((cat) => (
          <li key={cat.id}>
            <h2>{cat.title}</h2>
            <p>{cat.decription}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CatList;
